import React from 'react';
import logo from '../logo.svg';

const Projects = () => {
	return (
        <div>
                <p>
                Edit your life and save to reload.
                </p>
                <a
                    className="App-link"
                    href="https://reactjs.org"
                    target="_blank"
                    rel="noopener noreferrer"
                    >
                    Learn Projects
                </a>
        </div>
	);
};

export default Projects;
